// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

// Importing OpenZeppelin's ERC20 contract
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract SLRToken is ERC20 {
    address public dao; // Address of the DAO
    
    constructor(address _dao) ERC20("SLR", "SLR") {
        dao = _dao;
    }
    
    // Function to allow DAO to mint SLR tokens when receiving ETH
    receive() external payable {
        // Calculate the amount of SLR tokens to mint based on the ETH received
        uint256 slrAmount = msg.value; // 1 ETH = 1 SLR (for simplicity, you can adjust this conversion ratio)
        
        // Mint SLR tokens to the sender (assuming DAO mints tokens and assigns to the sender)
        _mint(msg.sender, slrAmount);
    }
    
    // Private function to redeem SLR tokens for ETH and transfer ETH to specified address
    function redeemTokens(uint256 _amount, address payable _recipient) private {
        require(_amount > 0, "Amount must be greater than 0");
        require(balanceOf(msg.sender) >= _amount, "Insufficient balance");
        
        // Burn the redeemed SLR tokens
        _burn(msg.sender, _amount);
        
        // Calculate the equivalent ETH amount based on the redemption ratio (1 SLR = 1 ETH for simplicity)
        uint256 ethAmount = _amount;
        
        // Transfer ETH to the recipient
        _recipient.transfer(ethAmount);
    }
    
    // Public function to allow token holders to redeem SLR tokens for ETH
    function redeemSLRForETH(uint256 _amount, address payable _recipient) public {
        redeemTokens(_amount, _recipient);
    }
}

